import React, { Component } from 'react';

class Timer extends Component {
  render() {
    return (
      <div className="App">
        <h1>Stopwatch</h1>
        <Timer />
      </div>
    );
  }
}

function Timer() {
  return (
    <div>
      <p>0ms</p>
      <button>Start</button>
      <button>Reset</button>
    </div>
  );
}


  export default Timer
